function Todo({todos, completeTodos }) {
    const [edit, setEdit] = useState({
        id: null, 
        value: ''
    });



    return todos.map((todo, index) => (
        <div 
        className = {todo.isComplete ? 'todo-row complete' : 'todo-row'} 
        key={index}
        >
            <div key = {todo.id} onClick={() => completeTodo(todo.id)}>
                {todo.text}
        </div>
        <div className='icons'>
            <RiCloseCircleLine />
            <TiEdit />
        </div>

        </div>
))
}

export default Todo
